import React, { Component } from 'react'
import './DivButton.scss';

export default class DivButton extends Component {
    static propTypes = {
        label: PropTypes.string
    }
    constructor(props){
        super(props);
        this.state = {
            value: "",
            type: (this.props && this.props.type ? this.props.type : "text"),
            label: (this.props && this.props.label ? this.props.label : ""),
            isRequired: (this.props && this.props.isRequired ? this.props.isRequired: false)
        }
    }
    render() {
        return (
            <div className="nav-btn-container">
                <div className="nav-btn">
                    <div className="nav-btn-icon">

                    </div>
                    <div className="nav-btn-text">
                        Configure swab sampling parameter
                    </div>
                </div>
            </div>
        )
    }
}
